import {
    createRouter,
    createWebHashHistory
} from 'vue-router'

const E404 = ()=> import('./../views/404.vue')
const User = ()=> import('./../views/user.vue')
const Home = ()=> import('./../views/home.vue')

const routes = [
    {
        path: '/home',
        name: 'home',
        component: Home
    },
    {
        path: '/user',
        name: 'user',
        component: User
    },
    {
        path: '/',
        redirect: '/home',
        component: Home
    },
    {
        path: '/404',
        name: '404',
        component: E404
    }
]
export default createRouter({
    history: createWebHashHistory(),
    routes
});
